import React from 'react'

const SearchBar = (props) => {
    return (
        <div>
            <h1>Search a Currency</h1>
            <form>
                <input type="text" placeholder="Search" onChange={this.props.handleSearch()}/>
            </form>
        </div>
    )
}

export default SearchBar
